:"function loadNewImage(filter,id) {\n    var filter = filter.toUpperCase();\n    var im = JS9.GetImage({display: filter});\n    if( im ){\n        JS9.CloseImage({display: im});\n    }\n    var fits = 'cutouts/' + id.toString() + '_' + filter + '.fits.gz'; \n    JS9.Load(fits, {zoom:'toFit', scale:'sqrt', scaleclipping:'zscale'}, {display:filter});\n}\n\nvar inds = ha_source.selected['1d'].indices[0];\nvar data = ha_source.data;\n\nvar allfilters = ['DIFF_E1','F658N_E1','F625W_E1','DIFF_E2','F658N_E2','F625W_E2',\n                  'F275W','F336W','F475W','F814W','F110W','F160W'];\nvar stats = ['Best','Exp','p16','p50','p84'];\n\nif (typeof(cb_obj.selected) != 'undefined') {\n    var id = data['id'][inds];\n    for ( i = 0; i < allfilters.length; i++) {\n        loadNewImage(allfilters[i],id);\n    }\n    var filt = filters.data;\n    var filt_f = filters_flux.data;\n    var mags = [16,28];\n    for (i = 0; i < filt['wav'].length; i++) {\n        var key = filt['key'][i];\n        var mag = data[key.toLowerCase() + '_vega'][inds];\n        var rate = data[key.toLowerCase() + '_rate'][inds];\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        filt['mag'][i] = mag;\n        filt['rates'][i] = rate;\n        if ((key != 'F625W') && (key != 'F658N')) {\n            var k = i;\n            if (i > 2) { k = i - 2; }\n            for (j = 0; j < stats.length; j++) {\n                var detector;\n                if ((key == 'F475W') || (key == 'F814W')) {\n                    detector = 'ACS_WFC';\n                } else {\n                    detector = 'WFC3';\n                }\n                var flux_nd = data['logHST_' + detector + '_' + key + '_nd_' + stats[j]][inds];\n                var flux_wd = data['logHST_' + detector + '_' + key + '_wd_' + stats[j]][inds];\n                filt_f['flux_nd_'+stats[j]][k] = flux_nd;\n                filt_f['flux_wd_'+stats[j]][k] = flux_wd;\n            }\n        }\n    }\n    filters.trigger('change');\n    filters_flux.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag < 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag > 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"30e1df4a-5b95-46aa-b2bb-1d6907238459","type":"CustomJS"},{"attributes":{"bottom_units":"screen","fill_alpha":{"value":0.5},"fill_color":{"value":"lightgrey"},"left_units":"screen","level":"overlay","line_alpha":{"value":1.0},"line_color":{"value":"black"},"line_dash":[4,4],"line_width":{"value":2},"plot":null,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"617a45f1-876c-4b68-bb4a-801bcd259498","type":"BoxAnnotation"},{"attributes":{"plot":null,"text":"F658N vs F814W sharpness"},"id":"dc08908e-d97d-469b-9ce5-7dcc9ef83f45","type":"Title"},{"attributes":{"callback":{"id":"30e1df4a-5b95-46aa-b2bb-1d6907238459","type":"CustomJS"},"plot":{"id":"da3fc04c-5734-4353-a252-b57ca4f895d9","subtype":"Figure","type":"Plot"}},"id":"13706233-a4c5-48ba-a8c0-4be14276067e","type":"TapTool"},{"attributes":{"dimension":1,"plot":{"id":"a01b08a3-443f-4f83-ab18-003893e75c55","subtype":"Figure","type":"Plot"},"ticker":{"id":"0d7fa76a-53ff-466a-8fa8-e8fdb384063e","type":"BasicTicker"}},"id":"56eebb82-238d-4aea-8542-c2950397944b","type":"Grid"},{"attributes":{"active_drag":"auto","active_scroll":"auto","active_tap":"auto","tools":[{"id":"10efe172-157d-4418-96a9-013379f900b8","type":"PanTool"},{"id":"1ea3e59d-c400-4c1c-bc73-4c4e8a27c6b9","type":"WheelZoomTool"},{"id":"64c98249-da1d-46fb-a4ff-fe2eac8b25c8","type":"BoxZoomTool"},{"id":"8e97b881-955e-4a8
